## Answer (0)

This is not possible in the current version of Rasa.

The way the `FormAction` is designed is that it will continue to ask questions until it has all the required slots filled.

You can, however, design your form to ask for the `letter` slot first and then for the `number` slot.

```
class SevenWondersForm(FormAction):
    def name(self):
        return "seven_wonders_form"

    @staticmethod
    def required_slots(tracker):
        return ["letter", "number"]

    def slot_mappings(self):
        return {
            "letter": self.from_entity("letter"),
            "number": self.from_entity("number"),
        }

    async def submit(self, dispatcher, tracker, domain):
        dispatcher.utter_message("You have selected {} wonders that start with {}".format(
            tracker.get_slot("number"),
            tracker.get_slot("letter")
        ))

